      value: '<p>Many of us in the Drupal community enjoy coffee, and the Drupal Coffee Exchange is a way to celebrate the magic elixir that many of us use to fuel our days.</p><p>Our quarterly coffee exchanges and periodic BoFs at Drupal events are a way for community members to stay caffeinated and share their favorite coffees between enthusiasts. It’s unique, it’s fun, and it’s become a creative and complementary way to participate in our community....a reminder our community goes well beyond the commits.</p>'
